//@ Metamask connection
const isConnectMetaMask = async () => { 
  //console.log('메타마스크연결 함수 실행');
  const accounts = await window.ethereum.request({
    method: 'eth_requestAccounts',
  }); 
};


export { isConnectMetaMask };
